CREATE MATERIALIZED VIEW stream_query AS SELECT ARRAY['3bfeos3oxK', 'xpJR3MD8Pp', '0HprgLlHpQ', 'N2Nxwjn9XU'] AS col_0, (substr((CASE WHEN true THEN t_0.p_brand WHEN true THEN t_0.p_brand ELSE t_0.p_type END), t_0.p_size)) AS col_1 FROM part AS t_0 WHERE true GROUP BY t_0.p_size, t_0.p_type, t_0.p_brand HAVING true;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
CREATE MATERIALIZED VIEW stream_query AS SELECT (CASE WHEN t_1.c1 THEN (-1642752405) WHEN t_1.c1 THEN ((BIGINT '62') % t_0.p_retailprice) ELSE t_0.p_retailprice END) AS col_0, t_0.p_retailprice AS col_1, t_1.c1 AS col_2, t_0.p_retailprice AS col_3 FROM part AS t_0 LEFT JOIN alltypes2 AS t_1 ON t_0.p_comment = t_1.c9 AND t_1.c1 GROUP BY t_1.c3, t_1.c2, t_0.p_retailprice, t_1.c1, t_1.c16, t_0.p_partkey;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
